[[backends]]
  group = "google-cloud-pub-sub-v1beta1a-subscriptions"
  slug = "google-cloud-pub-sub-v1beta1a-v1beta1a-subscriptions"
  url_pattern = "/v1beta1a/subscriptions"
  method = "GET"
  host = ["https://pubsub.googleapis.com"]
  query_string_params = ["pageToken", "query", "maxResults"]
  whitelist = ["subscription", "nextPageToken"]
  [backends.extra_config]
    hosts = ["https://pubsub.googleapis.com"]
    schemes = ["https"]

